description:
In this corner: hot-assed, hot-blooded Latina Franceska Jaimes. In that corner: hugely hung superstud/filthy filmmaker Nacho Vidal. The director's epic, new movie is dedicated to the curvy, fiery bitch, and the &quot;Nacho vs. Franceska Jaimes&quot; title is perhaps telling given that the combatants are real-life husband and wife! Really, all marriages need the sexual energy, variety and friction Mr. and Mrs. Vidal expose here. For the opening menage-a-trois they invite a second Latina who contrasts strikingly with hard-bodied, monster-assed Franceska: petite, playful, exceptionally girly Kristina Rose.


